import logo from './logo.svg';
import './App.css';
import MainContent from './MainContent';
import Header from './Header';

function App() {
  return (
    <div className="app">
      <div className="app__container">
        <div className="app__header">
          <Header/>
        </div>
        <div className="app__content">
          <MainContent/>
        </div>
      </div>
    </div>
  );
}

export default App;
